import {useState} from 'react';
import Movie from './Movie';
import './MovieList.css';
    function MovieList(){
        const [movies,setmovies] =useState([
          {
            name: "Harry Potters",
            price: 1234
          },
          {
            name: "Game of Thrones",
            price: 562
          },
          {
            name: "Friends",
            price: 5623,
          }
        ])
        return(
            <div>
                {
                    movies.map (movie => (
                        <Movie name={movie.name} price={movie.price}/>
                    ))
                }
            </div>
        );
    }; 

    export default MovieList;
